let info;
let alertActive;

function callback () {
    // eslint-disable-next-line no-undef
    chrome.alarms.create('alertTimer', {periodInMinutes: 1, when: Date.now()});
    // eslint-disable-next-line no-undef
    chrome.alarms.onAlarm.addListener((alarms) => {
      let now = new Date();
      let str = [now.getHours(), now.getMinutes(), '0'].map(t => t < 10 ? '0'+ t : t).join(':');
      if (info.times.includes(str)) {
        // eslint-disable-next-line no-undef
        chrome.notifications.create(null, {
          type: "basic",
          iconUrl: "drink1.png",
          title: "喝水小助手",
          message: info.alertContent || "看到此消息的人可以和我一起来喝一杯水",
        });
        // eslint-disable-next-line no-undef
        chrome.tabs.query({}, function (tabs) {
          tabs.length && tabs.forEach((tab, i) => {
            tab.url.startsWith('http') && imgTab(tab);
          })
        })
      }
    })
}

function changeImg(timeStay) {
    let img = document.createElement('img');
    img.src = 'data:image/jpeg;base64,';
    img.style = 'position: fixed;width: 100%;top: 0;z-index:9999;';
    img.alt = "drink";

    document.body.appendChild(img);
    setTimeout(() => {
      document.body.removeChild(img);
    }, (timeStay || 5) * 1000);
}

function imgTab(tab) {
  // eslint-disable-next-line no-undef
  chrome.scripting.executeScript({
    target: {tabId: tab.id, allFrames: true},
    func: changeImg,
    args: [info.timeStay]
  }).catch((err) => {
    console.log(err, tab);
  });;
}

// eslint-disable-next-line no-undef
chrome.storage.onChanged.addListener(function (changes, namespace) {
  for (let [key, { oldValue, newValue }] of Object.entries(changes)) {
    if (key === 'alertTimeInfo' && newValue) {
      info = newValue;
      alertActive = newValue.alertActive
    }
  }
  // eslint-disable-next-line no-undef
  chrome.alarms.clear('alertTimer');
  if (alertActive && info) {
    callback()
  }
});
// eslint-disable-next-line no-undef
chrome.storage.sync.get('alertTimeInfo', (res) => {
  if (res.alertTimeInfo) {
    info = res.alertTimeInfo;
    alertActive = info.alertActive;
  }
  // eslint-disable-next-line no-undef
  chrome.alarms.clear('alertTimer');
  if (alertActive && info) {
    callback()
  }
})